import React, { useState } from 'react';
import DataWithAll from './DataWithAll';


const OurPlans = () =>{
    
const card = (val) =>{
    return(
        <>
        <div className="card" style={{backgroundImage:`url(${val.reference})` , backgroundSize:'cover'}}>
            <h1>{val.title}</h1>
            <p>{val.treks}<sub>Treks</sub></p>
        </div>
        </>
    )
}


return(
<>
<h3>See Our Plans</h3>
<div className="plan">
{
    DataWithAll.map(card)
}
</div>
</> 
      )
}

export default OurPlans;
